import React from "react";

interface DataItem {
    id: string;
    app: string;
    action: string;
    trigger: string;
    status: string;
  }

  interface TableContainerProps {
    data: DataItem[];
  }

const Table: React.FC<TableContainerProps> = ({ data }) => {
    return (
    <div>
        <p>Table Container</p>
        <table>
        <thead>
            <tr>
            <th>Application</th>
            <th>Action</th>
            <th>Trigger</th>
            <th>Status</th>
            </tr>
        </thead>


        </table>
    </div>
    );
};

export default Table;
